import React, { Component } from 'react';

class Home extends Component {
    render(){
        return(
            <>
            <div>
                <nav>
                    <a href='/'>Home</a>-
                    <a href='/contact'>Contact</a>-
                    <a href='/about'>About</a>-
                    <a href='/users'>Users</a>-
                </nav>
            </div>
                <h1>Welcome to my page</h1>
            </>
        )
    }
}

export default Home;
